      amount: 194.65,
      date: new Date(2022, 4, 16)
    }
  ];

  return (
    <div>
      <p>This is a react app</p>
      {expenses.map(expense => (
          console.log(expense.title)

        ))

      }

    </div>
  );

}

export default App;
